import React from 'react';
import twitterIcon from './assets/twitter.svg';
import tiktokIcon from './assets/tiktok.svg';
import instagramIcon from './assets/instagram.svg';

const MigoLandingPage = () => {
  return (
    <div className="h-screen w-screen bg-white flex items-center justify-center relative overflow-hidden font-georgia">
      <div className="w-[95%] h-[95%] bg-gradient-to-br from-[#ebf4f5] to-[#b5c6e0] rounded-[50px] shadow-xl flex flex-col items-center justify-center relative">
        <h1 className="text-6xl font-bold mb-4">migo</h1>
        <h2 className="text-2xl mb-8">find your people</h2>
        <button className="bg-black text-white px-6 py-3 rounded-full text-lg hover:bg-gray-800 transition-colors">
          Join the waitlist
        </button>

        <div className="absolute bottom-4 right-4 flex flex-col items-end">
          <div className="flex space-x-4 mb-2">
            <button className="p-2 hover:bg-white/30 rounded-full transition-colors">
              <img src={instagramIcon} alt="Instagram" width="24" height="24" />
            </button>
            <button className="p-2 hover:bg-white/30 rounded-full transition-colors">
              <img src={tiktokIcon} alt="TikTok" width="24" height="24" />
            </button>
            <button className="p-2 hover:bg-white/30 rounded-full transition-colors">
              <img src={twitterIcon} alt="Twitter" width="24" height="24" />
            </button>
          </div>
          <p className="text-sm">&copy; Migo 2024</p>
        </div>
      </div>
    </div>
  );
};

export default MigoLandingPage;
